//该文件专门用来创建整个应用的路由器
import VueRouter from 'vue-router'
//引入组件
import music from '../pages/Asides/mains/music.vue'
import recommend from '../pages/Asides/mains/musics/recommend.vue'
import songlist from '../pages/Asides/mains/musics/songlist.vue'
import register from '../pages/Header/register.vue'
import rankinglist from '../pages/Asides/mains/musics/rankinglist.vue'
import singer from '../pages/Asides/mains/musics/singer.vue'
import newest from '../pages/Asides/mains/musics/newest.vue'
import particulars from '../pages/Asides/mains/particulars.vue'
import singerxq from '../pages/Asides/mains/particulars/singerxq.vue'
import Large from '../pages/Asides/mains/particulars/singerxq/Large.vue'
import List from '../pages/Asides/mains/particulars/singerxq/List.vue'
import Tulist from '../pages/Asides/mains/particulars/singerxq/Tulist.vue'
import Mv from '../pages/Asides/mains/particulars/singerxq/Mv.vue'
import Xq from '../pages/Asides/mains/particulars/singerxq/Xq.vue'
import Xs from '../pages/Asides/mains/particulars/singerxq/Xs.vue'
import Zj from '../pages/Asides/mains/particulars/singerxq/Zj.vue'
import podcast from '../pages/Asides/podcast/podcast.vue'
import details from '../pages/Asides/podcast/details.vue'
import videos from '../pages/Asides/mains/video/videos.vue'
import MV from '../pages/Asides/mains/video/MV.vue'
import SP from '../pages/Asides/mains/video/SP.vue'
import allmv from '../pages/Asides/mains/video/allmv.vue'
import play from '../pages/Asides/videoofmv/play.vue'
import privatefm from '../pages/Asides/mains/FM/privatefm.vue'
import replace from 'core-js/library/fn/symbol/replace'
import {
	push
} from 'core-js/fn/array'
//创建并暴露一个路由器
export default new VueRouter({
	routes: [{
			name: 'gomusic',
			path: '/music',
			component: music,
			children: [{
					name: 'gorecommend',
					path: 'recommend',
					component: recommend
				},
				{
					name: 'gosonglist',
					path: 'songlist',
					component: songlist
				},
				{
					name: 'gorankinglist',
					path: 'rankinglist',
					component: rankinglist
				},
				{
					name: 'gosinger',
					path: 'singer',
					component: singer
				},
				{
					name: 'gonewest',
					path: 'newest',
					component: newest
				}
			]
		},
		{
			name: 'goparticulars',
			path: '/particulars',
			component: particulars
		},
		{
			name: 'gosingerxq',
			path: '/singerxq',
			component: singerxq,
			children: [{
					name: 'goZj',
					path: 'Zj',
					component: Zj,
					children: [{
							name: 'goLarge',
							path: 'Large',
							component: Large
						},
						{
							name: 'goList',
							path: 'List',
							component: List
						},
						{
							name: 'goTulist',
							path: 'Tulist',
							component: Tulist
						}
					]
				},
				{
					name: 'goMv',
					path: 'Mv',
					component: Mv
				},
				{
					name: 'goXq',
					path: 'Xq',
					component: Xq
				},
				{
					name: 'goXs',
					path: 'Xs',
					component: Xs
				}
			]
		},
		{
			name: 'gopodcast',
			path: '/podcast',
			component: podcast,
			children: [
				{
					name: 'godetails',
					path: 'details',
					component: details
				}
			]
		},
		{
			name:'govideos',
			path:'/videos',
			component:videos,
			children:[
				{
					name:'goSP',
					path:'SP',
					component:SP
				},
				{
					name:'goMV',
					path:'MV',
					component:MV
				}
			]
		},
		{
			name:'goallmv',
			path:'/allmv',
			component:allmv
		},
		{
			name:'goplay',
			path:'/play',
			components:{
				videomv:play
			}
		},
		{
			name:'goprivatefm',
			path:'/privatefm',
			component:privatefm
		},
	]
})
